export const Container = styled.div`
    
.conteudo{

    display: flex;
    justify-content: space-between;
    
    .barraEsquerda{
        width:20%;
        background-color: red;
        display: flex;
        flex-direction: column;
        justify-content: center;
    }

    .barraCentral{
        width: 60%;
        background-color: blue;
        display: flex;
        flex-direction: column;
        justify-content: center;
    }

    .barraDireita{
        width:20%;
        background-color: green;
        display: flex;
        flex-direction: column;
        justify-content: center;

    }
}

`
